import Tone from 'tone'

function seq1(leadSynth) {
  let seq = new Tone.Sequence(
    function(time, note) {
      console.log(time, note)
      //straight quater notes
      leadSynth.triggerAttackRelease
    },
    ['A3', 'C4', 'E3', 'E3', 'A3', 'C4', 'A2'],
    '4n'
  )
  return seq
}

export { seq1 }
